import './App.css';
import axios from 'axios'
import { useState } from 'react';
import { Button, Card, CardGroup, Col, Container, Row } from 'react-bootstrap'
import { RiMoneyDollarCircleLine } from 'react-icons/ri';

function App() {

  const [properties, setProperties] = useState([])

  const handleSubmit = async (event) => {
    event.preventDefault()
    await axios.get('http://localhost:8000/huurwoningen/')
      .then(response => {
        setProperties(response.data)
        console.log(response.data)
      })
      .catch(error => {
        console.log('not worked')
        setProperties(['not good'])
      })
  }

  const currentTime = new Date()

  return (
    <Container>
      <h1 style={{textAlign: 'center'}}>Huurwoningen's listings </h1>
      <div className="d-flex align-items-center justify-content-center">
        <Button onClick={handleSubmit} variant="dark">Press me!</Button>        
      </div>
      <Row className="g-4 pt-3">
        <CardGroup>
          {properties.map((element, index) => {
            return(
              <Col md={3} key={index} className="pb-3 ps-1 p-1">
                <Card>
                  <Card.Img variant="top" src={element[3]} />
                  <Card.Body>
                    <Card.Title>
                      <a href={element[1]}>
                        {element[0]}
                      </a>
                    </Card.Title>
                    <Card.Text>
                      <p>
                        <RiMoneyDollarCircleLine size={20} style={{ verticalAlign: 'middle', marginRight: '5px' }} />
                        {element[2]}
                      </p>
                      <Row>
                        <Col md={4}>
                          <p>
                            <RiMoneyDollarCircleLine size={20} style={{ verticalAlign: 'middle', marginRight: '5px' }} />
                            {element[4]}
                          </p>
                          <p>
                            <RiMoneyDollarCircleLine size={20} style={{ verticalAlign: 'middle', marginRight: '5px' }} />
                            {element[5]}
                          </p>
                          <p>
                            <RiMoneyDollarCircleLine size={20} style={{ verticalAlign: 'middle', marginRight: '5px' }} />
                            {element[6]}
                          </p>
                        </Col>
                      </Row>
                    </Card.Text>
                  </Card.Body>
                  <Card.Footer>
                    <small className="text-muted">Last updated: {currentTime.toLocaleDateString()} at {currentTime.getHours()}:{currentTime.getMinutes()}</small>
                  </Card.Footer>
                </Card>
              </Col>
            )
          })}
        </CardGroup>
      </Row>
    </Container>
  );
}

export default App;
